INSERT INTO !PREFIX!_content (idcontent, idartlang, idtype, typeid, value, version, author, created, lastmodified) VALUES (22, 5, 1, 1, 'Unsere Site ist online mit einem CMS', '', 'admin', '2003-05-15 14:35:52', '2003-05-15 17:57:46');
INSERT INTO !PREFIX!_content (idcontent, idartlang, idtype, typeid, value, version, author, created, lastmodified) VALUES (23, 5, 1, 2, 'In wenigen Wochen wurde unsere Site mit einem Open Source Content Management System erstellt.', '', 'admin', '2003-05-15 14:35:52', '2003-05-15 17:57:46');
INSERT INTO !PREFIX!_content (idcontent, idartlang, idtype, typeid, value, version, author, created, lastmodified) VALUES (24, 5, 2, 1, '<P><BR>Hier kann die ausführliche Beschreibung der Implementierung erfolgen.</P>\r\n<P>Das Unternehmen</P>', '', 'admin', '2003-05-15 14:35:52', '2003-05-15 17:57:46');
INSERT INTO !PREFIX!_content (idcontent, idartlang, idtype, typeid, value, version, author, created, lastmodified) VALUES (25, 6, 1, 1, 'Im ersten Quartal starke Umsatzsteigerung zu vermelden', '', 'admin', '2003-05-15 14:38:10', '2003-05-15 18:05:43');
INSERT INTO !PREFIX!_content (idcontent, idartlang, idtype, typeid, value, version, author, created, lastmodified) VALUES (26, 6, 1, 2, 'Das Unternehmen hat sich in den angestammten Geschäftsbereichen stark entwickelt. Neue Kundensegmente konnten erschlossen werden.', '', 'admin', '2003-05-15 14:38:10', '2003-05-15 18:05:43');
INSERT INTO !PREFIX!_content (idcontent, idartlang, idtype, typeid, value, version, author, created, lastmodified) VALUES (27, 6, 2, 1, '<P><BR>Die ausführliche Erfolgsmeldung steht hier.</P>\r\n<P>Mehr dazu ...</P>', '', 'admin', '2003-05-15 14:38:10', '2003-05-15 18:05:43');
