INSERT INTO !PREFIX!_content (idcontent, idartlang, idtype, typeid, value, version, author, created, lastmodified) VALUES (62, 20, 1, 2, '<P>...auf Ihrer Website. Ihre Installation hat geklappt!</P>', '', 'admin', '2003-05-15 17:05:54', '2003-05-15 18:18:32');
INSERT INTO !PREFIX!_content (idcontent, idartlang, idtype, typeid, value, version, author, created, lastmodified) VALUES (63, 20, 2, 1, '<P>Die Inhalte auf dieser Website können Sie nun mit dem Content Management System Contenido verwalten. Contenido bietet Ihnen eine Fülle von Möglichkeiten, um Ihre Website individuell zusammenzustellen.<BR><BR>Weitere Informationen zu Contenido finden Sie in dem beigefügten Handbuch, dem Whitepaper sowie unter <A href="http://www.contenido.de" target=_blank>www.contenido.de</A>. <BR><BR>Contenido ist ein CMS der <A href="http://www.4fb.de/" target=_blank>four for business AG</A>.</P>\r\n<P>Das Handbuch für Contenido können Sie <A href="<!--{contenido_web}-->cms/upload/pdf/Handbuch_Contenido_Version_43.pdf" target=_blank>hier downloaden</A>.&nbsp;</A></P>', '', 'admin', '2003-05-15 17:05:54', '2003-05-15 18:18:32');
