INSERT INTO !PREFIX!_lay (idlay, idclient, name, description, deletable, code, author, created, lastmodified) VALUES (1, 1, 'Standard', 'Das Standard Layout\r\n\r\nContainer 1: Bildmodul\r\nContainer 2: Servicenavigation\r\nContainer 3: Bildmodul\r\nContainer 4: Navigation\r\nContainer 5: Headline\r\nContainer 6: Subheadline\r\nContainer 7: Text (HTML)\r\nContainer 8: Artikelliste\r\nContainer 9: Bildmodul\r\nContainer 10: Bildmodul\r\n\r\n\r\n', 1, '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN">\r\n\r\n<html>\r\n<head>\r\n        <title>Contenido</title>\r\n        <link rel="stylesheet" type="text/css" href="css/format.css">\r\n</head>\r\n\r\n<body bgcolor="white" style="margin:0px">\r\n<table width="100%" height="100%" cellspacing="0" cellpadding="0" border="0">\r\n<tr><td height="5"></td></tr>\r\n<tr><td align="center">\r\n<table width="800" border="0" height="100%" cellspacing="0" cellpadding="0">\r\n <tr>\r\n   <td width="200" align="center">CMS_CONTAINER[1]</td>\r\n    <td align="center" height="80" with="400">\r\n     <table width="400" border="0" height="80" cellspacing="0" cellpadding="0" background="images/background.jpg" style="border: 1px;border-color: #F7C473; border-style: dashed; background-color: #FCF2D5">\r\n     <tr><td>\r\n     <table border="0" cellspacing="0" cellpadding="0" width="400" height="80">\r\n     <tr><td> </td></tr><tr><td align="right" valign="bottom">\r\n\r\n     <!--hilfsnavi-->\r\n     CMS_CONTAINER[2]\r\n     <!--hilfsnavi ende-->\r\n\r\n     </td></tr>\r\n     </table>\r\n     </td></tr>\r\n     </table>\r\n\r\n    </td>\r\n    <td width="200" align="center">CMS_CONTAINER[3]</td>\r\n  </tr>\r\n\r\n  <tr><td colspan="3" height="5"></td></tr>\r\n\r\n\r\n  <tr>\r\n    <td align="right" valign="top">\r\n     <!--navi-->\r\n     CMS_CONTAINER[4]\r\n     <!--navi ende-->\r\n\r\n    </td>\r\n     <td valign="top">\r\n      <!--inhalt-->\r\n        <table width="400" height="50%" border="0" cellspacing="0" cellpadding="0" style="border: 1px;border-color: #F7C473; border-style: dashed; background-color: #FCF2D5">\r\n         <tr><td height="20" colspan="2"> </td></tr>\r\n        <tr><td rowspan="3" width="25"> </td>\r\n        <td valign="top" height="30" class="headline">CMS_CONTAINER[5]</td></tr>\r\n        <tr><td valign="top" height="30" class="subheadline">CMS_CONTAINER[6]</td></tr>\r\n        <tr><td valign="top" height="100%" class="text">CMS_CONTAINER[7]</td></tr>\r\n     </table>\r\n       <!--inhalt ende-->\r\n      </td>\r\n\r\n     <td align="center" valign="top">\r\n\r\n        <table cellspacing="0" cellpadding="0" border="0">\r\n\r\n            <tr>\r\n                <td>CMS_CONTAINER[8]</td>\r\n            </tr>\r\n            \r\n            <tr>\r\n                <td>CMS_CONTAINER[9]</td>\r\n            </tr>\r\n            \r\n            <tr>\r\n                <td>CMS_CONTAINER[10]</td>\r\n            </tr>\r\n\r\n        </table>\r\n\r\n</td></tr></table>\r\n\r\n</td></tr></table>\r\n</body>\r\n</html>', 'admin', '2003-05-15 12:23:06', '2003-05-15 17:43:22');
